"use strict";

import $ from "jquery";


function getElementData() {
    return $.getJson("./ElementData.json").then(function(elementData) {
        return elementData;
    });
}


function getElementMeasurementUnits() {
    return $.getJson("./ElementMeasurementUnits.json").then(function (data) {
        return { elementData: data };
    });
}


export { getElementData, getElementMeasurementUnits }
